import  React, {Component,ReactNode} from 'react';
import './Header.css';

type Props = {
    a:any;

}

export default class Header extends Component<Props>{
    render(){
        let {a}=this.props;
        return(

          <div className = "nav_bar">
              <img src = {require ("./images/msg.svg/")}/>
              <p id = 'pos_a'>{a}</p>
              <p id = 'pos_b'>Nandana Lekshmi Deepu</p>
              <p id = 'pos_c'>Albums</p>
              <p id = 'pos_d'>Sign Out</p>
          </div>
        );

    }
}
